module.exports = "<div class=\"content-sm container plain-content\">\r\n\t<div class=\"row\">\r\n\t\t<div class=\"col-lg-10 col-lg-offset-1\">\r\n\t\t\t<h1>Low-Power IoT</h1>\r\n\t\t\t<div class=\"well\">\r\n\t\t\t\t<em>\r\n\t\t\t\t\tThe power consumption of trillions of devices has become a major challenge in the IoT era. Can nonvolatile processors save power for the IoT?\r\n\t\t\t\t</em>\r\n\t\t\t</div>\r\n\t\t\t<!--<div class=\"embed-responsive embed-responsive-16by9 margin-b-30\">-->\r\n          <!--<iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/UaXRcAYKol8\"></iframe>-->\r\n\t\t\t<!--</div>-->\r\n\t\t\t<p>Quite a lot of IoT devices serve as remote sensors which collect physical data from their surrounding environment. Usually these remote sensors are located in far away or dangerous places, and work in a \"normally-off\" pattern. They have no need for high performance or data throughput, but requires extremely long battery life because changing or recharging batteries will be costly! </p> \r\n\t\t\t<div class=\"figure\">\r\n\t\t\t\t<img class=\"img-responsive img-center\" src=\"assets/showcase/normally-off.png\" alt=\"Normally-off requres low standby power\">\r\n\t\t\t\t<div class=\"caption\">Figure 1: Energy analysis of normally-off IoT devices</div>\r\n\t\t\t</div>\r\n\t\t\t<p>For such applications, the processor's leakage power becomes the main limiting factor to battery life. This is because they stay in standby mode in more than 99% of the time (Figure 1). Here we assume the standby power is 1uW and the active power is 1mW, while the sensor node senses data (which takes ~1ms) once every 10 seconds. We can calculate that for every cycle (10s), the sensing activity costs 1mW * 1ms = 1uJ energy, but the standby mode costs 1uW * 10s = 10uJ! That is to say, more than 90% of total energy is wasted on the standby mode.</p>\r\n\t\t\t<p>Fortunately, nonvolatile processor is an ideal choice for normally-off applications thanks to its <strong>literally-zero standby power</strong>. It executes sensing tasks when needed, and standby at zero cost in the rest of the time. In this way, nonvolatile processor helps normally-off IoT devices save precious energy and extend their service life</p> \r\n\t\t\t<div class=\"figure\">\r\n\t\t\t\t<img class=\"img-responsive img-center\" src=\"assets/showcase/bridge.png\" alt=\"A bridge health monitoring system using nonvolatile processor based sensor node\">\r\n\t\t\t\t<div class=\"caption\">Figure 2: A bridge health monitoring system using nonvolatile processor based sensor node</div>\r\n\t\t\t</div>\r\n\t\t\t<p>Figure 2 shows a normally-off bridge health monitoring system using nonvolatile processor based sensor nodes. The total energy is expected to be reduced by 40% thanks to the zero standby power of nonvolatile processor. </p>\r\n\r\n\t\t</div>\r\n\t</div>\r\n</div>\r\n"

