module.exports = "<div class=\"content-sm container plain-content\">\r\n\t<div class=\"row\">\r\n\t\t<div class=\"col-lg-10 col-lg-offset-1\">\r\n\t\t\t<h1>Self-Powered Wearables</h1>\r\n\t\t\t<div class=\"well\">\r\n\t\t\t\t<em>\r\n\t\t\t\tRespiration rate (rate of breathing) is a primary vital sign that indicates human body's functions. Meanwhile, breathing generates distance movement, which can be collected as energy. Can we monitor breathing condition using breathing energy?\r\n\t\t\t\t</em>\r\n\t\t\t</div>\r\n\t\t\t<div class=\"embed-responsive embed-responsive-16by9 margin-b-30\">\r\n    \t\t\t<iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/jK77uDYnLV4\"></iframe>\r\n\t\t\t</div>\r\n\t\t\t<p>Breathing generates distance movement, which can be collected as energy. These energy can be utilized to measure the frequency of breathing, and even heart-rate and pulse oximeter. There's a wide range of applications such as wearable devices for babies, pregnants and fitness people. </p>\r\n\t\t\t<p>However, one of the most challenging thing about monitoring breathing with breathing power is that <strong>the power is neither stable nor continuous</strong>. Using conventional microprocessors in such systems will lead to an unfortunate dilemma: the frequent power outage will destroy all intermediate data in the processor, while storing all those data into Flash memory is both energy and time consuming. </p> \r\n\t\t\t<p>Fortunately, nonvolatile processor makes it possible to survive a power failure at negligible time and energy cost. This demo video shows a self-powered breath monitoring system consisting of a breath energy harvester (from Tahzib Safwat @ Penn State University), a nonvolatile processor and a LCD screen. The screen shows pulsed data including averaged breathing frequency and last time breath frequency. The higher 2 bits of LCD screen stand for average breathing frequency calculated through past 3 times breathing intervals. The lower 2 bits stand for the last time breathing frequency. An \"L\" indicates your breathing is too slow (&#60;12 times/min), and an \"H\" indicates too high breathing frequency (&#62;48 times/min).</p>\r\n\t\t</div>\r\n\t</div>\r\n</div>\r\n"

